import * as rating from "@ibrains-design/rating-group"
import { useMachine, normalizeProps } from "@ibrains-design/react"
import { HalfStar, Star } from "./icons"

function Rating() {
  const [state, send] = useMachine(rating.machine({ id: "1" }))

  const api = rating.connect(state, send, normalizeProps)

  return (
    <div {...api.getRootProps()}>
      <label {...api.getLabelProps()}>Rate:</label>
      <div {...api.getControlProps()}>
        {api.items.map((index) => {
          const state = api.getItemState({ index })
          return (
            <span key={index} {...api.getItemProps({ index })}>
              {state.half ? <HalfStar /> : <Star />}
            </span>
          )
        })}
      </div>
      <input {...api.getHiddenInputProps()} />
    </div>
  )
}
